Set the data-l10n-id and data-l10n-args attributes on a DOM element. DOMLocalization makes use of mutation observers to detect change to data-l10n-* attributes and translate elements asynchronously. setAttributes is a convenience method which allows to translate DOM elements declaratively. You should always prefer to use data-l10n-id on elements (statically in HTML or dynamically via setAttributes) over manually retrieving translations with format. The use of attributes ensures that the elements can be retranslated when the user changes their language preferences. localization.setAttributes( document.querySelector('#welcome'), 'hello', { who: 'world' }
); This will set the following attributes on the #welcome element. The MutationObserver will pick up this change and will localize the element asynchronously. <p id='welcome' data-l10n-id='hello' data-l10n-args='{"who": "world"}'>
</p>

